import { useTranslation } from 'react-i18next';

import { Button, Dialog, DialogContent, DialogTitle } from '@mui/material';
import { makeStyles } from '@mui/styles';

const useStyles = makeStyles({});

export default function DialogFinalize(props) {
  const { open, handleClose, hadleStateRoute } = props;
  const { t } = useTranslation('travelsPage');
  const classes = useStyles();

  return (
    <Dialog
      open={open}
      onClose={handleClose}
      aria-labelledby="alert-dialog-title"
      aria-describedby="alert-dialog-description"
    >
      <DialogTitle id="alert-dialog-title">{t('TRAVEL_DIALOG_FINALIZE_TITLE')}</DialogTitle>
      <DialogContent dividers>
        <Button
          className="w-full my-5"
          onClick={(evt) => {
            evt.stopPropagation();
            hadleStateRoute('S');
          }}
          autoFocus
          variant="contained"
          color="secondary"
        >
          {t('TRAVEL_DIALOG_FINALIZE_TOUR_FINISHED')}
        </Button>
        <Button
          className="w-full my-5"
          onClick={(evt) => {
            evt.stopPropagation();
            hadleStateRoute('N');
          }}
          autoFocus
          variant="contained"
          color="secondary"
        >
          {t('TRAVEL_DIALOG_FINALIZE_SUSPENDED_TOUR')}
        </Button>
        <Button className="w-full my-5" onClick={handleClose} variant="contained" color="error">
          {t('TRAVEL_DIALOG_RUN_NEW_CANCEL')}
        </Button>
      </DialogContent>
    </Dialog>
  );
}
